import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
    appBar: {
        boxShadow: 'none',
        padding: '0 20px',
        position: 'sticky',
        // background: 'none'
        [theme.breakpoints.up('sm')]: {
            padding: '0 240px',
        }
    },
    toolbar: {
        
    }
}))
